A chain allocates identifiers when it creates clients, connections and channels. These identifiers can subsequently be used to refer to existing clients, connections and channels. Chains allocate identifiers using a chain specific allocation scheme. Currently, cosmos-SDK implementation uses: 07-tendermint-<n> for tendermint clients For example 07-tendermin-0 is assigned to the first client created on ibc-1: hermes tx raw create-client ibc-1 ibc-0 | jq { "status": "success", "result": { "CreateClient": { "client_id": "07-tendermint-0", "client_type": "Tendermint", "consensus_height": { "revision_height": 44895, "revision_number": 0 }, "height": "1" } }
} We will create a second client on ibc-1 with identifier 07-tendermint-1 in the client tutorial. connection-<n> for connections For example connection-0 is assigned to the first connection created on ibc-1: hermes tx raw conn-init ibc-1 ibc-0 07-tendermint-0 07-tendermint-0 | jq { "status": "success", "result": { "OpenInitConnection": { "client_id": "07-tendermint-0", "connection_id": "connection-0", "counterparty_client_id": "07-tendermint-0", "counterparty_connection_id": null, "height": "1" } }
} We will create a second connection on ibc-1 with identifier connection-1 in the connection tutorial. channel-<n> for channels For example channel-0 is assigned to the first channel created on ibc-1: hermes tx raw chan-open-init ibc-1 ibc-0 connection-0 transfer transfer | jq {
"status": "success",
"result": { "OpenInitChannel": { "channel_id": "channel-2", "connection_id": "connection-0", "counterparty_channel_id": null, "counterparty_port_id": "transfer", "height": "1", "port_id": "transfer" }
}
} We will create a second channel on ibc-1 with identifier channel-1 in the channel tutorial. In the following tutorials the ibc-0 and ibc-1 chains are setup and configured. For clarity, the tutorials run on a setup where the identifiers allocated to the client, connection and channel on ibc-0 are 07-tendermint-0, connection-0 and channel-0 respectively. Identifiers allocated to the client, connection and channel on ibc-1 are 07-tendermint-1, connection-1 and channel-1 respectively. If you want to ensure you get the same identifiers while following the tutorial, run the above three commands once on ibc-1 before going over the next sections.

